def all_right_truncatable_prime(numbers):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    def is_truncatable_prime(n):
        if not is_prime(n):
            return False
        while n > 10:
            n //= 10
            if not is_prime(n):
                return False
        return True

    x = numbers[31]
    primes = []
    for i in range(2, x):
        if is_truncatable_prime(i):
            primes.append(i)
    return sorted(primes, reverse=True)
